import React from 'react';
import { Box, Heading, Text } from '@chakra-ui/react';

const HowAreWe = () => {
  return (
    <Box id="how-are-we" py={12} px={8} bg="gray.100">
      <Heading mb={4}>How Are We</Heading>
      <Text>
        We are a community of passionate coders who come together to test our skills and push the limits of what's possible. Join us for our annual programming contest where creativity and innovation meet.
      </Text>
    </Box>
  );
};

export default HowAreWe;
